from PIL import Image
import os
import subprocess
import requests
import io
from io import BytesIO
import base64
base = ""
img_data = base64.b64decode(base)
background = Image.open(BytesIO(img_data))

def create_dir():
    if not os.path.exists("results"):
        os.makedirs("results")

def replace():
    global pic, ext, w
    pic = input("请将图片\033[1m拖入此处\033[0m或\033[1m填入图片名\033[0m：")  # 中间夹者图
    response()
    if w == 0:
        if '"' in pic:
            pic = pic.replace('"', '')  # 将引号去掉
        ext = os.path.splitext(pic)[1]  # 获取后缀

def response():
    global w
    global pic
    if "http" in pic or "https" in pic:
        pic_response = requests.get(pic)
        if pic_response.status_code == 200:  # GET 200 OK
            # 将响应内容转换为 BytesIO 对象
            global image_bytes
            image_bytes = io.BytesIO(pic_response.content)
            w = 1
        else:
            print(pic_response.status_code)
            print("图片获取失败，请检查链接是否正确")
            exit()
    else:
        w = 0

def wis1():
        global image_path
        image_path = f"results/{name}.jpg"
        if os.path.exists(image_path):
            new_name = input(f"文件名\033[1m{name}.jpg\033[0m已存在，请指定一个新的名称(按下\033[1m回车为\033覆盖原图片)：")
            if new_name == "":
                background.save(image_path)
            else:
                image_path = f"results/{new_name}.jpg"
                background.save(image_path)
        else:
            background.save(image_path)
def wis0():
        global image_path
        image_path = f"results/{name}{ext}"
        if os.path.exists(image_path):
            new_name = input(f"文件名\033[1m{name}{ext}\033[0m已存在，请指定一个新的名称(按下\033[1m回车为\033覆盖原图片)：")
            if new_name == "":
                background.save(image_path)
            else:
                image_path = f"results/{new_name}{ext}"
                background.save(image_path)
        else:
            background.save(image_path)
def save():
    if name == "":
        background.show()
    else:
        if w == 1:
            wis1()
        else:
            wis0()
        print(f"图片已保存至：{image_path}")
        subprocess.run(['start', image_path], shell=True)  # 利用系统方式打开保存的图片

if __name__ == '__main__':
    create_dir()
    replace()
    
    if w == 1:
        overlay = Image.open(image_bytes)  # 中间夹者图
    else:
        overlay = Image.open(pic)  # 中间夹者图
        
    if overlay.mode != 'RGBA':  # 如果叠加图片不是RGBA模式，则转换为RGBA模式
        overlay = overlay.convert('RGBA')
    
    overlay = overlay.resize((600, 600))  # 调整图片大小
    position = (680, 100)  # 这里是background图片的合适位置
    background.paste(overlay, position, overlay)  # 叠加
    
    # 询问保存的文件名
    name = input("请输入想要保存的\033[1m文件名\033[0m(按下\033[1m回车为\033[1m预览\033[0m)：")
    save()
